import React from 'react'

export default () => {

    const createcolumns = () => {
        const column = []
        for(let i=0; i<=35; i++) {
            let classnames = [`column c${i}`]
            column.push(<div className={classnames}></div>)
        }

        return column
    }

    const createrows = () => {
        const row = []
        for(let i=0; i<=35; i++) {
            let classnames = [`row r${i}`]
            row.push(<div className={classnames}>{createcolumns}</div>)
        }
    }

    return (
        <div className='grid'>
            {createrows()}
        </div>
    )

}
